__NUXT_JSONP__("/drugs/Everolimus", (function(a,b,c,d,e,f,g,h,i,j,k,l){return {data:[{drug:{slug:a,emaEpar:[{activeSubstance:b,conditionIndication:"Hormone-receptor-positive advanced breast cancerAfinitor is indicated for the treatment of hormone-receptor-positive, HER2\u002Fneu-negative advanced breast cancer, in combination with exemestane, in post-menopausal women without symptomatic visceral disease after recurrence or progression following a non-steroidal aromatase inhibitor.Neuroendocrine tumours of pancreatic originAfinitor is indicated for the treatment of unresectable or metastatic, well or moderately differentiated neuroendocrine tumours of pancreatic origin in adults with progressive disease.Neuroendocrine tumours of gastrointestinal or lung originAfinitor is indicated for the treatment of unresectable or metastatic, well-differentiated (Grade 1 or Grade 2) non-functional neuroendocrine tumours of gastrointestinal or lung origin in adults with progressive disease.Renal-cell carcinomaAfinitor is indicated for the treatment of patients with advanced renal-cell carcinoma, whose disease has progressed on or after treatment with VEGF-targeted therapy.",inn:b,marketingAuthorisationDate:"2009-08-02 00:00:00",marketingAuthorisationHolder:d,medicineName:c,url:"https:\u002F\u002Fwww.ema.europa.eu\u002Fen\u002Fmedicines\u002Fhuman\u002FEPAR\u002Fafinitor"},{activeSubstance:b,conditionIndication:"Renal angiomyolipoma associated with tuberous sclerosis complex (TSC)Votubia is indicated for the treatment of adult patients with renal angiomyolipoma associated with tuberous sclerosis complex (TSC) who are at risk of complications (based on factors such as tumour size or presence of aneurysm, or presence of multiple or bilateral tumours) but who do not require immediate surgery.The evidence is based on analysis of change in sum of angiomyolipoma volume.Subependymal giant cell astrocytoma (SEGA) associated with tuberous sclerosis complex (TSC)Votubia is indicated for the treatment of patients with subependymal giant cell astrocytoma (SEGA) associated with tuberous sclerosis complex (TSC) who require therapeutic intervention but are not amenable to surgery.The evidence is based on analysis of change in SEGA volume. Further clinical benefit, such as improvement in disease‑related symptoms, has not been demonstrated.",inn:b,marketingAuthorisationDate:"2011-09-02 00:00:00",marketingAuthorisationHolder:d,medicineName:e,url:"https:\u002F\u002Fwww.ema.europa.eu\u002Fen\u002Fmedicines\u002Fhuman\u002FEPAR\u002Fvotubia"}],fdaDrugLabel:[{brand:a,indication:"1. INDICATIONS AND USAGE Everolimus tablets are a kinase inhibitor indicated for the treatment of: Adults with advanced renal cell carcinoma (RCC) after failure of treatment with sunitinib or sorafenib. ( 1.3 ) Adults with renal angiomyolipoma and tuberous sclerosis complex (TSC), not requiring immediate surgery. ( 1.4 ) Everolimus tablets are kinase inhibitors indicated for the treatment of adult and pediatric patients aged 1 year and older with TSC who have subependymal giant cell astrocytoma (SEGA) that requires therapeutic intervention but cannot be curatively resected. ( 1.5 ) 1.3 Renal Cell Carcinoma (RCC) Everolimus tablets are indicated for the treatment of adult patients with advanced RCC after failure of treatment with sunitinib or sorafenib. 1.4 Tuberous Sclerosis Complex (TSC)-Associated Renal Angiomyolipoma Everolimus tablets are indicated for the treatment of adult patients with renal angiomyolipoma and TSC, not requiring immediate surgery. 1.5 Tuberous Sclerosis Complex (TSC)-Associated Subependymal Giant Cell Astrocytoma (SEGA) Everolimus tablets are indicated in adult and pediatric patients aged 1 year and older with TSC for the treatment of SEGA that requires therapeutic intervention but cannot be curatively resected.",manufacturer:f,splSetId:"01f7b5fb-be0d-4adf-acd2-6899018de966"},{brand:c,indication:"1 INDICATIONS AND USAGE AFINITOR is a kinase inhibitor indicated for the treatment of: Postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane after failure of treatment with letrozole or anastrozole. ( 1.1 ) Adults with progressive neuroendocrine tumors of pancreatic origin (PNET) and adults with progressive, well-differentiated, non-functional neuroendocrine tumors (NET) of gastrointestinal (GI) or lung origin that are unresectable, locally advanced or metastatic. Limitations of Use: AFINITOR is not indicated for the treatment of patients with functional carcinoid tumors. ( 1.2 ) Adults with advanced renal cell carcinoma (RCC) after failure of treatment with sunitinib or sorafenib. ( 1.3 ) Adults with renal angiomyolipoma and tuberous sclerosis complex (TSC), not requiring immediate surgery. ( 1.4 ) AFINITOR and AFINITOR DISPERZ are kinase inhibitors indicated for the treatment of adult and pediatric patients aged 1 year and older with TSC who have subependymal giant cell astrocytoma (SEGA) that requires therapeutic intervention but cannot be curatively resected. ( 1.5 ) AFINITOR DISPERZ is a kinase inhibitor indicated for the adjunctive treatment of adult and pediatric patients aged 2 years and older with TSC-associated partial-onset seizures. ( 1.6 ) 1.1 Hormone Receptor-Positive, HER2-Negative Breast Cancer AFINITOR ® is indicated for the treatment of postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane, after failure of treatment with letrozole or anastrozole. 1.2 Neuroendocrine Tumors (NET) AFINITOR is indicated for the treatment of adult patients with progressive neuroendocrine tumors of pancreatic origin (PNET) with unresectable, locally advanced or metastatic disease. AFINITOR is indicated for the treatment of adult patients with progressive, well-differentiated, non-functional NET of gastrointestinal (GI) or lung origin with unresectable, locally advanced or metastatic disease. Limitations of Use: AFINITOR is not indicated for the treatment of patients with functional carcinoid tumors [see Clinical Studies (14.2)] . 1.3 Renal Cell Carcinoma (RCC) AFINITOR is indicated for the treatment of adult patients with advanced RCC after failure of treatment with sunitinib or sorafenib. 1.4 Tuberous Sclerosis Complex (TSC)-Associated Renal Angiomyolipoma AFINITOR is indicated for the treatment of adult patients with renal angiomyolipoma and TSC, not requiring immediate surgery. 1.5 Tuberous Sclerosis Complex (TSC)-Associated Subependymal Giant Cell Astrocytoma (SEGA) AFINITOR and AFINITOR DISPERZ ® are indicated in adult and pediatric patients aged 1 year and older with TSC for the treatment of SEGA that requires therapeutic intervention but cannot be curatively resected. 1.6 Tuberous Sclerosis Complex (TSC)-Associated Partial-Onset Seizures AFINITOR DISPERZ is indicated for the adjunctive treatment of adult and pediatric patients aged 2 years and older with TSC-associated partial-onset seizures.",manufacturer:g,splSetId:"2150f73a-179b-4afc-b8ce-67c85cc72f04"},{brand:a,indication:"1 INDICATIONS AND USAGE Everolimus Tablets is a kinase inhibitor indicated for the treatment of: Postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane after failure of treatment with letrozole or anastrozole. ( 1.1 ) Adults with progressive neuroendocrine tumors of pancreatic origin (PNET) Limitations of Use : Everolimus Tablets is not indicated for the treatment of patients with functional carcinoid tumors. ( 1.2 ) Adults with advanced renal cell carcinoma (RCC) after failure of treatment with sunitinib or sorafenib. ( 1.3 ) Adults with renal angiomyolipoma and tuberous sclerosis complex (TSC), not requiring immediate surgery. ( 1.4 ) Everolimus Tablets are kinase inhibitors indicated for the treatment of adult and pediatric patients aged 1 year and older with TSC who have subependymal giant cell astrocytoma (SEGA) that requires therapeutic intervention but cannot be curatively resected. ( 1.5 ) 1.1 Hormone Receptor-Positive, HER2-Negative Breast Cancer (Advanced HR+ BC) Everolimus Tablets are indicated for the treatment of postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane, after failure of treatment with letrozole or anastrozole. 1.2 Neuroendocrine Tumors (NET) Everolimus Tablets are indicated for the treatment of adult patients with progressive neuroendocrine tumors of pancreatic origin (PNET) with unresectable, locally advanced or metastatic disease. Limitations of Use : Everolimus Tablets are not indicated for the treatment of patients with functional carcinoid tumors [see Clinical Studies ( 14.2 )]. 1.3 Renal Cell Carcinoma (RCC) Everolimus Tablets are indicated for the treatment of adult patients with advanced RCC after failure of treatment with sunitinib or sorafenib. 1.4 Tuberous Sclerosis Complex (TSC)-Associated Renal Angiomyolipoma Everolimus Tablets are indicated for the treatment of adult patients with renal angiomyolipoma and TSC, not requiring immediate surgery. 1.5 Tuberous Sclerosis Complex (TSC)-Associated Subependymal Giant Cell Astrocytoma (SEGA) Everolimus Tablets are indicated in adult and pediatric patients aged 1 year and older with TSC for the treatment of SEGA that requires therapeutic intervention but cannot be curatively resected.",manufacturer:"Par Pharmaceutical, Inc.",splSetId:"45d54974-3fc4-4237-a2fa-3158ca1a8105"},{brand:a,indication:"1 INDICATIONS AND USAGE Everolimus is a kinase inhibitor indicated for the treatment of: • Adults with advanced renal cell carcinoma (RCC) after failure of treatment with sunitinib or sorafenib. ( 1.3 ) • Adults with renal angiomyolipoma and tuberous sclerosis complex (TSC), not requiring immediate surgery. ( 1.4 ) 1.3 Renal Cell Carcinoma (RCC) Everolimus is indicated for the treatment of adult patients with advanced RCC after failure of treatment with sunitinib or sorafenib. 1.4 Tuberous Sclerosis Complex (TSC)-Associated Renal Angiomyolipoma Everolimus is indicated for the treatment of adult patients with renal angiomyolipoma and TSC, not requiring immediate surgery.",manufacturer:h,splSetId:"5aaf2fb7-93f6-40d6-941a-9583a3794ce7"},{brand:i,indication:"1 INDICATIONS AND USAGE Everolimus Tablets are kinase inhibitor indicated for the treatment of: Postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane after failure of treatment with letrozole or anastrozole. ( 1.1 ) Adults with renal angiomyolipoma and tuberous sclerosis complex (TSC), not requiring immediate surgery. ( 1.4 ) Everolimus tablets are kinase inhibitors indicated for the treatment of adult and pediatric patients aged 1 year and older with TSC who have subependymal giant cell astrocytoma (SEGA) that requires therapeutic intervention but cannot be curatively resected. ( 1.5 ) 1.1 Hormone Receptor-Positive, HER2-Negative Breast Cancer Everolimus Tablets are indicated for the treatment of postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane, after failure of treatment with letrozole or anastrozole. 1.4 Tuberous Sclerosis Complex (TSC)-Associated Renal Angiomyolipoma Everolimus tablets are indicated for the treatment of adult patients with renal angiomyolipoma and TSC, not requiring immediate surgery. 1.5 Tuberous Sclerosis Complex (TSC)-Associated Subependymal Giant Cell Astrocytoma (SEGA) Everolimus tablets are indicated in adult and pediatric patients aged 1 year and older with TSC for the treatment of SEGA that requires therapeutic intervention but cannot be curatively resected.",manufacturer:"Biocon Pharma Inc.",splSetId:"5fb55800-f322-6bb6-9dde-622925ef28bd"},{brand:b,indication:"1 INDICATIONS AND USAGE Everolimus tablets are a kinase inhibitor indicated for the treatment of: • Postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane after failure of treatment with letrozole or anastrozole. ( 1.1 ) • Adults with renal angiomyolipoma and tuberous sclerosis complex (TSC), not requiring immediate surgery. ( 1.4 ) Everolimus tablets are a kinase inhibitor indicated for the treatment of adult and pediatric patients aged 1 year and older with TSC who have subependymal giant cell astrocytoma (SEGA) that requires therapeutic intervention but cannot be curatively resected. ( 1.5 ) 1.1 Hormone Receptor-Positive, HER2-Negative Breast Cancer Everolimus tablets are indicated for the treatment of postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane, after failure of treatment with letrozole or anastrozole. 1.4 Tuberous Sclerosis Complex (TSC)-Associated Renal Angiomyolipoma Everolimus tablets are indicated for the treatment of adult patients with renal angiomyolipoma and TSC, not requiring immediate surgery. 1.5 Tuberous Sclerosis Complex (TSC)-Associated Subependymal Giant Cell Astrocytoma (SEGA) Everolimus tablets are indicated in adult and pediatric patients aged 1 year and older with TSC for the treatment of SEGA that requires therapeutic intervention but cannot be curatively resected.",manufacturer:j,splSetId:"b7c7c9a4-994f-43dc-8cd6-cd6eeed6fa89"},{brand:a,indication:"1 INDICATIONS AND USAGE Everolimus is an mTOR inhibitor immunosuppressant indicated for the prophylaxis of organ rejection in adult patients: Kidney Transplant : at low-moderate immunologic risk. Use in combination with basiliximab, cyclosporine (reduced doses) and corticosteroids. ( 1.1 ) Liver Transplant : Administer no earlier than 30 days post-transplant. Use in combination with tacrolimus (reduced doses) and corticosteroids. ( 1.2 , 5.5 ) Limitations of Use ( 1.3 ) Safety and efficacy have not been established in the following: Kidney transplant patients at high immunologic risk ( 1.3 ) Recipients of transplanted organs other than kidney or liver ( 1.3 , 5.7 ) Pediatric patients (less than 18 years) ( 1.3 ) 1.1 Prophylaxis of Organ Rejection in Kidney Transplantation Everolimus is indicated for the prophylaxis of organ rejection in adult patients at low-moderate immunologic risk receiving a kidney transplant [see Clinical Studies (14.1) ] . Everolimus is to be administered in combination with basiliximab induction and concurrently with reduced doses of cyclosporine and with corticosteroids. Therapeutic drug monitoring (TDM) of everolimus and cyclosporine is recommended for all patients receiving these products [see Dosage and Administration (2.2 , 2.3) ]. 1.2 Prophylaxis of Organ Rejection in Liver Transplantation Everolimus is indicated for the prophylaxis of allograft rejection in adult patients receiving a liver transplant. Everolimus is to be administered no earlier than 30 days post-transplant concurrently in combination with reduced doses of tacrolimus and with corticosteroids [see Warnings and Precautions (5.5) , Clinical Studies (14.2) ] . TDM of everolimus and tacrolimus is recommended for all patients receiving these products [see Dosage and Administration (2.3 , 2.5) ] . 1.3 Limitations of Use The safety and efficacy of everolimus has not been established in the following populations: Kidney transplant patients at high immunologic risk Recipients of transplanted organs other than kidney and liver [see Warnings and Precautions (5.7) ] Pediatric patients (less than 18 years).",manufacturer:f,splSetId:"c7bb6ba1-9a7f-43f5-b058-ef26d4b59221"},{brand:a,indication:"1 INDICATIONS AND USAGE Everolimus tablets for oral suspension are a kinase inhibitor indicated for the treatment of adult and pediatric patients aged 1 year and older with TSC who have subependymal giant cell astrocytoma (SEGA) that requires therapeutic intervention but cannot be curatively resected. ( 1.5 ) Everolimus tablets for oral suspension are a kinase inhibitor indicated for the adjunctive treatment of adult and pediatric patients aged 2 years and older with TSC-associated partial-onset seizures. ( 1.6 ) 1.5 Tuberous Sclerosis Complex (TSC)-Associated Subependymal Giant Cell Astrocytoma (SEGA) Everolimus tablets for oral suspension are indicated in adult and pediatric patients aged 1 year and older with TSC for the treatment of SEGA that requires therapeutic intervention but cannot be curatively resected. 1.6 Tuberous Sclerosis Complex (TSC)-Associated Partial-Onset Seizures Everolimus tablets for oral suspension are indicated for the adjunctive treatment of adult and pediatric patients aged 2 years and older with TSC-associated partial-onset seizures.",manufacturer:j,splSetId:"ca1a987e-f763-4026-93c5-c545ca95826c"},{brand:a,indication:"1 INDICATIONS AND USAGE • Everolimus is a mTOR inhibitor immunosuppressant indicated for the prophylaxis of organ rejection in adult patients: • Kidney Transplant: at low-moderate immunologic risk. Use in combination with basiliximab, cyclosporine (reduced doses) and corticosteroids. ( 1.1 ) • Liver Transplant: Administer no earlier than 30 days post-transplant. Use in combination with tacrolimus (reduced doses) and corticosteroids. ( 1.2 , 5.5 ) Limitations of Use ( 1.3 ) Safety and efficacy have not been established in the following: • Kidney transplant patients at high immunologic risk. ( 1.3 ) • Recipients of transplanted organs other than kidney or liver. ( 1.3 , 5.7 ) • Pediatric patients (less than 18 years). ( 1.3 ) 1.1 Prophylaxis of Organ Rejection in Kidney Transplantation Everolimus is indicated for the prophylaxis of organ rejection in adult patients at low-moderate immunologic risk receiving a kidney transplant [see Clinical Studies ( 14.1 )] . Everolimus is to be administered in combination with basiliximab induction and concurrently with reduced doses of cyclosporine and with corticosteroids. Therapeutic drug monitoring (TDM) of everolimus and cyclosporine is recommended for all patients receiving these products [see Dosage and Administration ( 2.2 and 2.3 )] . 1.2 Prophylaxis of Organ Rejection in Liver Transplantation Everolimus is indicated for the prophylaxis of allograft rejection in adult patients receiving a liver transplant. Everolimus is to be administered no earlier than 30 days post-transplant concurrently in combination with reduced doses of tacrolimus and with corticosteroids [see Warnings and Precautions ( 5.5 ) and Clinical Studies ( 14.2 )] . Therapeutic drug monitoring (TDM) of everolimus and tacrolimus is recommended for all patients receiving these products [ s ee Dosage and Administration ( 2.3 , 2.5 )] . 1.3 Limitations of Use The safety and efficacy of everolimus has not been established in the following populations: • Kidney transplant patients at high immunologic risk • Recipients of transplanted organs other than kidney and liver [see Warnings and Precautions ( 5.7 )] • Pediatric patients (less than 18 years).",manufacturer:h,splSetId:"cf2dd54b-7a1d-4401-9a01-75e68235e433"},{brand:k,indication:"1 INDICATIONS AND USAGE • Zortress is an mTOR inhibitor immunosuppressant indicated for the prophylaxis of organ rejection in adult patients: • Kidney Transplant: at low-moderate immunologic risk. Use in combination with basiliximab, cyclosporine (reduced doses) and corticosteroids ( 1.1 ) • Liver Transplant: Administer no earlier than 30 days posttransplant. Use in combination with tacrolimus (reduced doses) and corticosteroids ( 1.2 , 5.5 ) Limitations of Use ( 1.3 ) Safety and efficacy have not been established in the following: • Kidney transplant patients at high immunologic risk ( 1.3 ) • Recipients of transplanted organs other than kidney or liver ( 1.3 , 5.7 ) • Pediatric patients (less than 18 years) ( 1.3 ) 1.1 Prophylaxis of Organ Rejection in Kidney Transplantation Zortress is indicated for the prophylaxis of organ rejection in adult patients at low-moderate immunologic risk receiving a kidney transplant [ see Clinical Studies (14.1)] . Zortress is to be administered in combination with basiliximab induction and concurrently with reduced doses of cyclosporine and with corticosteroids. Therapeutic drug monitoring (TDM) of everolimus and cyclosporine is recommended for all patients receiving these products [ see Dosage and Administration (2.2 , 2.3)] . 1.2 Prophylaxis of Organ Rejection in Liver Transplantation Zortress is indicated for the prophylaxis of allograft rejection in adult patients receiving a liver transplant. Zortress is to be administered no earlier than 30 days posttransplant concurrently in combination with reduced doses of tacrolimus and with corticosteroids [ s ee Warnings and Precautions (5. 5 ) , Clinical Studies (14.2) ] . TDM of everolimus and tacrolimus is recommended for all patients receiving these products [ s ee Dosage and Administration (2.3 , 2.5)] . 1.3 Limitations of Use The safety and efficacy of Zortress has not been established in the following populations: Kidney transplant patients at high immunologic risk Recipients of transplanted organs other than kidney and liver [ s ee Warnings and Precautions (5. 7 ) ] Pediatric patients (less than 18 years).",manufacturer:g,splSetId:"e082a024-7850-400b-a5c2-2a140612562a"},{brand:a,indication:"1 INDICATIONS AND USAGE Everolimus tablets are a kinase inhibitor indicated for the treatment of: Postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane after failure of treatment with letrozole or anastrozole. ( 1.1 ) Adults with progressive neuroendocrine tumors of pancreatic origin (PNET) and adults with progressive, well-differentiated, non-functional neuroendocrine tumors (NET) of gastrointestinal (GI) or lung origin that are unresectable, locally advanced or metastatic. Limitations of Use: Everolimus tablets are not indicated for the treatment of patients with functional carcinoid tumors. ( 1.2 ) Adults with advanced renal cell carcinoma (RCC) after failure of treatment with sunitinib or sorafenib. ( 1.3 ) Adults with renal angiomyolipoma and tuberous sclerosis complex (TSC), not requiring immediate surgery. ( 1.4 ) Everolimus tablets are a kinase inhibitor indicated for the treatment of adult and pediatric patients aged 1 year and older with TSC who have subependymal giant cell astrocytoma (SEGA) that requires therapeutic intervention but cannot be curatively resected. ( 1.5 ) 1.1 Hormone Receptor-Positive, HER2-Negative Breast Cancer Everolimus tablets are indicated for the treatment of postmenopausal women with advanced hormone receptor-positive, HER2-negative breast cancer in combination with exemestane, after failure of treatment with letrozole or anastrozole. 1.2 Neuroendocrine Tumors (NET) Everolimus tablets are indicated for the treatment of adult patients with progressive neuroendocrine tumors of pancreatic origin (PNET) with unresectable, locally advanced or metastatic disease. Everolimus tablets are indicated for the treatment of adult patients with progressive, well-differentiated, non-functional NET of gastrointestinal (GI) or lung origin with unresectable, locally advanced or metastatic disease. Limitations of Use: Everolimus tablets are not indicated for the treatment of patients with functional carcinoid tumors [see Clinical Studies ( 14.2 )] . 1.3 Renal Cell Carcinoma (RCC) Everolimus tablets are indicated for the treatment of adult patients with advanced RCC after failure of treatment with sunitinib or sorafenib. 1.4 Tuberous Sclerosis Complex (TSC)-Associated Renal Angiomyolipoma Everolimus tablets are indicated for the treatment of adult patients with renal angiomyolipoma and TSC, not requiring immediate surgery. 1.5 Tuberous Sclerosis Complex (TSC)-Associated Subependymal Giant Cell Astrocytoma (SEGA) Everolimus tablets are indicated in adult and pediatric patients aged 1 year and older with TSC for the treatment of SEGA that requires therapeutic intervention but cannot be curatively resected.",manufacturer:"Teva Pharmaceuticals USA, Inc.",splSetId:"e3bca36b-29ed-4a2b-a1be-a57b6af805f6"}],id:a,nciThesaurus:{casRegistry:"159351-69-6",chebiId:"",chemicalFormula:"C53H83NO14",definition:"A derivative of the natural macrocyclic lactone sirolimus with immunosuppressant and anti-angiogenic properties. In cells, everolimus binds to the immunophilin FK Binding Protein-12 (FKBP-12) to generate an immunosuppressive complex that binds to and inhibits the activation of the mammalian Target of Rapamycin (mTOR), a key regulatory kinase. Inhibition of mTOR activation results in the inhibition of T lymphocyte activation and proliferation associated with antigen and cytokine (IL-2, IL-4, and IL-15) stimulation and the inhibition of antibody production. (NCI05)",fdaUniiCode:"9HW64Q8G6G",identifier:"C48387",preferredName:a,semanticType:"Pharmacologic Substance",subclassOf:["C1742","C2201","C574"],synonyms:["(1R,9S,12S,15R,16E,18R,19R,21R,23S,24E,26E,28E,30S,32S,35R)-1,18-Dihydroxy-12-((1R)-2-((1S,3R,4R)-4-(2-hydroxyethoxy)-3-methoxycyclohexyl)-1-methylethyl)-19,30-dimethoxy-15,17,21,23,29,35-hexamethyl-11,36-dioxa-4-azatricyclo(30.3.1.04,9)hexatriaconta-16,24,26,28-tetraene-2,3,10,14,20-pentaone","42-O-(2-Hydroxy)ethyl Rapamycin",c,"Certican",i,a,"RAD 001","RAD001",e,k,b]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FEverolimus",extension:".json",createdAt:l,updatedAt:l}}],fetch:{},mutations:void 0}}("Everolimus","everolimus","Afinitor","Novartis Europharm Limited","Votubia","Breckenridge Pharmaceutical, Inc.","Novartis Pharmaceuticals Corporation","Hikma Pharmaceuticals USA Inc.","EVEROLIMUS","Mylan Pharmaceuticals Inc.","Zortress","2021-10-30T13:40:08.943Z")));